    init().then(() => {
      alert('Your secret is: ' + keygen(BigInt(23), 3));
    });
  }, []);



  return (
    <div className="App">
      <div className='Header'>
        <h2>DKG Wasm example</h2>
      </div>
    </div>
  );
}

export default App;
